import React from "react";

const styles = {
  title: {
    backgroundColor: "orange",
    width: 100,
    height: 100
  }
};

export const TodoMainTitle = () => {
  return (
    <div>
      <h6 style={styles.title}>{"Task manager"}</h6>
    </div>
  );
};

export default TodoMainTitle;
